import React from 'react'

import Held from './Held'
import Sprites from './Sprites'

const Pokemon = ({ pokemon }) => {
    return (
        <div>
            <Sprites sprites={pokemon.sprites}/> {pokemon.name}
            <Held held_items={pokemon.held_items}/>
        </div>
    )
}

export default Pokemon
